        public static PersonaSGPModel ObtenerPersonaSGP(string dni)
        {
            var personaSGP = new PersonaSGPModel();

            ServiceSGP.ServiceSoapClient servicesgp = new ServiceSGP.ServiceSoapClient("ServiceSoap");
            var personaDelSGP = servicesgp.Uniformado(dni);

            if ((personaDelSGP.Tables[0] != null))
            {
                personaSGP.Nombre = personaDelSGP.Tables[0].Rows[0]["Apellido_y_Nombre"].ToString();
                personaSGP.Apellido = personaDelSGP.Tables[0].Rows[0]["Apellido_y_Nombre"].ToString();
                personaSGP.Documento = personaDelSGP.Tables[0].Rows[0]["DNI"].ToString();
                personaSGP.Grado = personaDelSGP.Tables[0].Rows[0]["GRADO"].ToString();
                personaSGP.Unidad = personaDelSGP.Tables[0].Rows[0]["Unidad_de_Revista"].ToString();           
            }
            else
            {
                personaSGP = null;
            }

            
            return personaSGP;
        }

     
